import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Navbar.css';   // to alter the appearance of Navbar.js program

const Navbar = (props) => {
    const navigate = useNavigate(); // Initialize useNavigate hook for programmatic navigation

    // Handle navigation when the button is clicked
    const handleButtonClick = (e, path) => {
        // Prevent default behavior if user is not logged in
        e.preventDefault();

        if (!props.loggedIn) {
            navigate('/sign-in'); // Redirect to sign-in page if not logged in
        } else {
            navigate(path); // If logged in, navigate to the target path
        }
    };

    return (
        <nav className='navbar'>
            <ul className='nav-links'>
                <li>
                    <a href='/'>Home</a>
                </li>
                <li>
                    <a href='/create-event' onClick={(e) => handleButtonClick(e, '/create-event')}>
                        Create an Event
                    </a>
                </li>
                <li>
                    <a href='/profile' onClick={(e) => handleButtonClick(e, '/profile')}>
                        Profile
                    </a>
                </li>
            </ul>
        </nav>
    );
}
export default Navbar;
